import React from "react"
import ReactDOMClient from "react-dom/client"
import { useState } from "react"

var obj;

var ta = [];

var t1, t2, t3;

var idt = 0;

function setV(props) {
    var tariff = ta.find(el => el.Name == props);

    t1 = tariff.Name;
    t2 = tariff.Speed;
    t3 = tariff.Cost;

    idt = tariff.ID;

    document.getElementById("nameTariffch").value = t1;
    document.getElementById("speedTariffch").value = t2;
    document.getElementById("costTariffch").value = t3;
}

function Chtariff(props) {

    const [value, setValue] = useState('');

    const options = props.t.map((item) => {
        return <option key={item.ID}>{item.Name}</option>;
    });

    return (
        <div id="controlTariff">
            <div id="chtariff1">
                <p>Добавить тариф</p>
                <label htmlFor="nameTariff1">Название </label>
                <input type="text" id="nameTariff1"></input>
                <br></br><br></br>
                <label htmlFor="speedTariff1">Скорость </label>
                <input type="text" id="speedTariff1"></input>
                <br></br><br></br>
                <label htmlFor="costTariff1">Стоимость </label>
                <input type="text" id="costTariff1"></input>
                <br></br><br></br>
                <button onClick={addtariff}>Добавить</button>
            </div>

            <div id="chtariff1">
                <p>Изменение тарифа</p>
                <label htmlFor="nameTariffch">Название </label>
                <input type="text" id="nameTariffch"></input>
                <br></br><br></br>
                <label htmlFor="speedTariffch">Скорость </label>
                <input type="text" id="speedTariffch"></input>
                <br></br><br></br>
                <label htmlFor="costTariffch">Стоимость </label>
                <input type="text" id="costTariffch"></input>
                <br></br><br></br>
                <button onClick={chtariff}>Изменить</button>
            </div>

            <div>
                <p>Список тарифов</p>
                    <select id="listTariff" size="3" value={value} onChange={(event) => { setValue(event.target.value); setV(event.target.value) }}>
                        {options}
                    </select>
            </div>
        </div>
    )
}

export function chtariffset() {
    ta = [];
    const request = new XMLHttpRequest();

    const url = "http://localhost:8080/tariffs";

    request.open("GET", url, true);

    request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

    request.addEventListener("readystatechange", () => {

        if (request.readyState === 4 && request.status === 200) {
            var answer = request.responseText;
            var array = answer.split(';');

            for (let i = 1; i < array.length; i++) {
                obj = JSON.parse(array[i]);
                ta.push(obj);
            }
        }
        const fullinfo = ReactDOMClient.createRoot(document.getElementById("fullinfo"));
        fullinfo.render(<Chtariff t = {ta}/>);
    });

    request.send();
}

function chtariff() {
    const request = new XMLHttpRequest();

    const url = "http://localhost:8080/updtariff";
    
    const params = "ID=" + idt + "&Name=" + document.getElementById("nameTariffch").value
     + "&Cost=" + document.getElementById("costTariffch").value
      + "&Speed=" + document.getElementById("speedTariffch").value;

    request.open("POST", url, true);

    request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

    request.addEventListener("readystatechange", () => {

        if (request.readyState === 4 && request.status === 200) {
/*             var answer = request.responseText;
            var array = answer.split(';');

            for (let i = 1; i < array.length; i++) {
                obj = JSON.parse(array[i]);
                ta.push(obj);
            } */
            chtariffset();
        }
        //const fullinfo = ReactDOMClient.createRoot(document.getElementById("fullinfo"));
        //fullinfo.render(<Chtariff t = {ta}/>);
    });

    request.send(params);
}

function addtariff() {
    const request = new XMLHttpRequest();

    const url = "http://localhost:8080/addtariff";
    
    const params = "ID=" + idt + "&Name=" + document.getElementById("nameTariffch1").value
     + "&Cost=" + document.getElementById("costTariffch1").value
      + "&Speed=" + document.getElementById("speedTariffch1").value;

    request.open("POST", url, true);

    request.setRequestHeader("Content-type", "application/x-www-form-urlencoded");

    request.addEventListener("readystatechange", () => {

        if (request.readyState === 4 && request.status === 200) {
/*             var answer = request.responseText;
            var array = answer.split(';');

            for (let i = 1; i < array.length; i++) {
                obj = JSON.parse(array[i]);
                ta.push(obj);
            } */
            chtariffset();
        }
        //const fullinfo = ReactDOMClient.createRoot(document.getElementById("fullinfo"));
        //fullinfo.render(<Chtariff t = {ta}/>);
    });

    request.send(params);
}
